import React from 'react'
//import image from "image";
export default function links() {
  return (
    <div className='my-3'>
      <p><a href="/https://www.linedin.com/in/anmoldube/" className="link-warning link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover">LinkedIn</a>
<img src='/image/linkedin.png' alt="linkedin.png" width="20" height="20" /></p>

<p><a href="/https://www.instagram.com/anmol__dube/" className="link-warning link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover">Instagram</a>
<img src='/image/download (2).jpeg' alt="linen.png" width="20" height="20" /></p>

<p><a href="/https://github.com/Anmoldube" src="www.google.com" className="link-secondary link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover my-3 mt-3">Secondary link</a></p>
<p><a href="/" className="link-success link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover">Success link</a></p>
<p><a href="/" className="link-danger link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover">Danger link</a></p>

<p><a href="/" className="link-info link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover">Info link</a></p>
<p><a href="/" className="link-light link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover">Light link</a></p>
<p><a href="/" className="link-dark link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover">Dark link</a></p>
<p><a href="/" className="link-body-emphasis link-offset-2 link-underline-opacity-25 link-underline-opacity-75-hover">Emphasis link</a></p>
    </div>
  )
  }
